import React from "react";
import {Component} from "react";
import "./index2.scss"
import history from "./index"

class ProjectsComponent extends Component {
  constructor(props) {
    super(props);

    // // this.state = {
    // //   hidden: true,
    // //   password: ""
    // };

    // this.handlePasswordChange = this.handlePasswordChange.bind(this);
    // this.toggleShow = this.toggleShow.bind(this);
  }

// onSubmit = () => {
//   history.push("/");
// }

  render() {
    return (
      <div className="projectsPageContainer">
        <div className="sideMenu">
          <div className="top">
            <div className="menuIcon"></div>
            <div className="menu-home-container">
              <div className="menuHome"></div>
              <div className="sideMenuText">Home</div>
              </div>
            <div className="menu-about-container">
              <div className="menuAbout"></div>
              <div className="sideMenuText">About</div>
            </div>
            <div className="menu-settings-container">
              <div className="menuSettings"></div>
              <div className="sideMenuText">Settings</div>
            </div> 
          </div>
          <div className="bottomSideMenu">
            <div className="menuLogout"></div>
            <div className="sideMenuTextLogout">Logout</div>
          </div>
        </div>
        <div className="mainMenu">
          <div className="main-header">
            <div className="logo"></div>
            <div className="user">user@spectory.com</div>
          </div>
          <div className="lists">
            <div className="projectsList">
              <div className="projects-header">
                <div className="my-projects-header-text">My Projects</div>
                <div className="new-project-header">
                  <div className="new-project-header-text">New Project</div>
                  <div className="new-project-header-icon"></div>
                  </div>
              </div>
            </div>
            <div className="tasksList">
              <div className="tasks-header">
                <div className="current-project">Project name</div>
                <div className="new-task-header">
                  <div className="new-task-header-text">New Task</div>
                  <div className="new-task-header-icon"></div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ProjectsComponent;
